import React from 'react';
import './App.css';
import Row from './components/Row';

function App() {
  return (
    <>
      <div className="App">

        <Row
          color={[
            'rgba(180,180,180,1)',
            'rgba(150,150,150,1)',
            'rgba(120,120,120,1)',
          ]}
          height='50vh'
        />
        <Row
          color={[
            'rgba(180,180,180,1)',
            'rgba(150,150,150,1)',
            'rgba(120,120,120,1)',
          ]}
          height='50vh'
        />

      </div>


    </>
  );
}

export default App;
